const fatchDocument = async()=>{
let response = await fetch('https://api.github.com/users')
console.log('sdfasdf',response)
response = await response.json()
 console.log (response)
 setState(response)
}
useEffect(()=>{
  fatchDocument()
},[])

  
return (
<>
{state.slice(1,10).map((item,i)=>{
  return(<div>
    <table key={i}>
      <tr>
        <th>Id</th>
        <th>Profile Pic</th>
        <th>Profile Name</th>
        <th>Node Id</th>
        <th>Followers</th>
      </tr>
